void swap(float* a, float* b){
    float t = (*a);
    (*a) = (*b);
    (*b) = t;
}

int pivoting(float arr[],int b, int e){
    int pivot = (b + e) / 2;
    swap(&arr[pivot], &arr[e]);
    pivot = b;
    for(int i = b; i < e; i++){
        if(arr[i] <= arr[e])
            swap(&arr[i], &arr[pivot++]);
    }
    swap(&arr[pivot], &arr[e]);

    return pivot;
}

void sort(float arr[],int b, int e){
    if(b >= e)
        return;
    int pivot = pivoting(arr, b, e);
    sort(arr, b, pivot - 1);
    sort(arr, pivot + 1, e);
}


